sum_staff_lines_space = 0
for i, this_staff in enumerate(staff_lines):
    if i % 5 == 0:  # The staff_lines list index stats from 0
        continue
    else:
        last_staff = staff_lines[i - 1]
        staff_line_space = this_staff[0] - last_staff[0]
        sum_staff_lines_space += staff_line_space

staff_groups = len(staff_lines) / 5
num_staff_lines_space = len(staff_lines) - staff_groups
staff_line_space = sum_staff_lines_space / num_staff_lines_space

print('staff_line_space')
